import React from "react";
import "./Installation.css";
import NodeIcon from '../icons/icon_node';
import { Grid, Paper, Button, Fab, Box, Container } from '@material-ui/core';
import { Dashboard as DashboardIcon } from '@material-ui/icons';
import { withStyles, makeStyles  } from '@material-ui/core/styles';
import { LinkContainer } from "react-router-bootstrap"
import TopMenuBar from "../components/TopMenuBar";
import BottomButtons from '../components/bottomButtons';
import { flexbox } from '@material-ui/system';

const nodes = [
  {
    id: '1FG5dh7h1',
    name: 'FakeNode 1',
    group: 'Tomatoes',
    status: 'Offline',
    x: 65,
    y: 45,
    z: 10
  },{
    id: '1FG5dh7h2',
    name: 'FakeNode 2',
    group: 'Carrots',
    status: 'Online',
    x: 45,
    y: 45,
    z: 10
  },{
    id: '1FG5dh7h3',
    name: 'FakeNode 3',
    group: 'Tomatoes',
    status: 'Online',
    x: 65,
    y: 55,
    z: 10
  },{
    id: '1FG5dh7h4',
    name: 'FakeNode 4',
    group: 'Carrots',
    status: 'Online',
    x: 45,
    y: 55,
    z: 10
  },{
    id: '1FG5dh7h5',
    name: 'FakeNode 5',
    group: 'Carrots',
    status: 'Offline',
    x: 45,
    y: 65,
    z: 10
  },{
    id: '1FG5dh7h6',
    name: 'FakeNode 6',
    group: 'Tomatoes',
    status: 'Online',
    x: 65,
    y: 65,
    z: 10
  },{
    id: '1FG5dh7h7',
    name: 'FakeNode 7',
    group: 'Tomatoes',
    status: 'Online',
    x: 65,
    y: 75,
    z: 10
  },
];

const useStyles = makeStyles(theme => ({
  root:{
    height: '100%',
  },
  container: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
    minHeight: '100%'
  }
}));

export default function Home() {
  const offlineNodes = nodes.filter((node) => node.status === 'Offline');
  const onlineNodes = nodes.filter((node) => node.status === 'Online');
  const classes = useStyles();

  return (
    <>
      <TopMenuBar block pageName="Home" hamburgerMenu={true} closeButtonOnly={false} closeWithPrompt={false} backButton={false} backRoutePage="/"/>
      <section className={classes.root}>
        <div className={classes.container}>
        <Box display="flex"
          flexWrap="nowrap"
          flexGrow={1}>
            <Paper>
            <LinkContainer to="/nodes">
              <Button component="span" className={classes.nodeCount}>
                    {onlineNodes.length}/{nodes.length}
                    Online nodes
              </Button>
            </LinkContainer>
            <LinkContainer to="/nodes">
              <Button component="span" className={classes.nodeCount}>
                    {offlineNodes.length}/{nodes.length}
                    Offline nodes
              </Button>
            </LinkContainer>
            </Paper>

          </Box>
          <Box
            display="flex"
            flexWrap="nowrap"
            flexGrow={1}>
              <Paper>
                LUL
              </Paper>
            </Box>
          </div>
      </section>
      </>
  );
}
